  const host = "http://localhost:5000";
  const [event, setEvent] = useState({
        address: "",
        co_ordinator: "",
        date: "",
        edate: "",
        ename: "",
        etime: "",
        mode: "",
        org: "",
        phone: "",
        registration_fee: "",
        rules: "",
        __v: 0,
        _id: ""
